import React from "react";
import Header2 from "../2/Header2";
export default function Page3() {
    let date = new Date()
    let hours = date.getHours()
    let minutes = date.getMinutes()
    let timeofday;
    if (hours < 12) {
        timeofday = 'morning';
    } else if (hours === 12) {
        timeofday = 'noon';
    } else if (hours < 18) {
        timeofday = 'afternoon';
    } else {
        timeofday = 'evening';
    }

    return (
        <div>
            <Header2 />
            <h1> {hours}:{minutes} {timeofday}</h1>


        </div>
    )

}
